	module.exports = "<p>Immutable library can be useful but documentation is quite tricky to understand. I have just played a little with this library and wanted to share with you some examples.</p>\n<p>Written with <a href=\"http://www.typescriptlang.org/\">TypeScript</a> I guess it is why documentation is quite difficult to read first.</p>\n<h2 id=\"api\">API</h2>\n<p>Documentation use a very generic template syntax.</p>\n<h3 id=\"generic-constructors\">Generic constructors</h3>\n<pre><code class=\"lang-javascript\">Map&lt;K, V&gt;(): Map&lt;K, V&gt; // create a new immutable map\nSet&lt;T&gt;(): Set&lt;T&gt;\nList&lt;T&gt;(): List&lt;T&gt;\nStack&lt;T&gt;(): Stack&lt;T&gt;\nSet&lt;T&gt;(): Set&lt;T&gt;\n</code></pre>\n<p>Ok, it is quite simple, T (for Type) K (for Key) V (for Value) are generic type declaration which will be used by immutable implementation.</p>\n<p>Following commonly notation, keep it mind the following type parameter names:</p>\n<ul>\n<li>K - Key</li>\n<li>V - Value</li>\n<li>T - Type</li>\n<li>number - Number</li>\n<li>... maybe more</li>\n</ul>\n<h3 id=\"generic-methods\">Generic methods</h3>\n<p>Function signature follow this convention:</p>\n<pre><code class=\"lang-javascript\">nameCamelCase(...parameters) : newCurrentImmutableObjToReturn\n</code></pre>\n<p>What I just want to say is that you work on immutable data, so always use your <em>returned value</em>, otherwise...</p>\n<p>parameters in documentation are often named for more readability</p>\n<pre><code class=\"lang-javascript\">set(key: K, value: V): Map&lt;K, V&gt;\n// will be call this way\n// myMap.set(&#39;a&#39;, &#39;I am A&#39;);\n// myMap.set(&#39;b&#39;, &#39;I am B&#39;);\n</code></pre>\n<h3 id=\"es6\">ES6</h3>\n<p>Then Immutable embrace ES6 with Classes, Arrow Functions and Modules so it won&#39;t help you to read documentation if you do not know anything about it.</p>\n<p>But I am nice, I give you some details :)</p>\n<h4 id=\"arrow-function\">Arrow Function</h4>\n<p>Arrow Function sample extracted from Immutable documentation:</p>\n<pre><code class=\"lang-javascript\">// ES6\nfoo.map(x =&gt; x * x);\n// ES3\nfoo.map(function (x) { return x * x; });\n</code></pre>\n<p>Ok, but let&#39;s see an exemple on an Immutable Map.update() object method :</p>\n<pre><code class=\"lang-javascript\">update(key: K, updater: (value: V) =&gt; V): Map&lt;K, V&gt;\n</code></pre>\n<p>OMG, do not worry, difficult part to read is the parameter in parenthesis.</p>\n<pre><code class=\"lang-javascript\">(key: K, updater: (value: V) =&gt; V): Map&lt;K, V&gt;\n</code></pre>\n<p><em>Reminder</em></p>\n<pre><code class=\"lang-javascript\">(value: V) =&gt; V\n</code></pre>\n<p>is equivalent to</p>\n<pre><code class=\"lang-javascript\">function(value) {\n  // do something with value\n  return value;\n}\n</code></pre>\n<p>As explained before <code>key</code>,<code>updater</code> keywords are just there for readability, you do not write it when coding.</p>\n<p>Firt param is your map key, second one use an Arrow Function, see it in action:</p>\n<pre><code class=\"lang-javascript\">var value = {\n name: &#39;julien&#39;,\n aka: &#39;darul75&#39;\n};\n\n// create a new map\nvar myMap = Immutable.Map({});\n// add a value, note we play with immutable object, so keep in mind\n// to always return and erase old one\n// Example:\n// myMap = myMap.set(&#39;myMapKey&#39;, value);\n\n// we gonna update &#39;aka&#39; attribute value from &#39;darul75&#39; to &#39;darul&#39;\nvar newMyMap = myMap.update(&#39;myMapKey&#39;, (myMapValue) =&gt; {\n  myMapValue.aka = &#39;darul&#39;;\n  // if map value is also Immutable map it will be\n  // myMapValue = myMapValue.set(&#39;aka&#39;, &#39;darul&#39;);\n  return myMapValue;\n});\n\nconsole.log(newMyMap.get(&#39;myMapKey&#39;));\n// Object {name: &quot;julien&quot;, aka: &quot;darul&quot;}\n</code></pre>\n<h3 id=\"iterable\">Iterable</h3>\n<p>Iterating over your collection of data, you might all know what Iterable and Iterator mean.</p>\n<p>All collections in Immutable are extending Iterable following common (key, value) pattern.</p>\n<pre><code class=\"lang-javascript\">Iterable&lt;K, V&gt;\n</code></pre>\n<h4 id=\"example-with-native-immutable-map\">Example with native Immutable Map</h4>\n<pre><code class=\"lang-javascript\">var value = {\n name: &#39;julien&#39;,\n aka: &#39;darul75&#39;\n};\nvar myMap = Immutable.Map({});\nmyMap = myMap.set(&#39;myMapKey&#39;, value);\nvar myArrayIterator = Immutable.Iterable(myMap);\n// not needed by default as Map implement it by debault\nconsole.log(myArrayIterator.first());\n// Object {name: &quot;julien&quot;, aka: &quot;darul&quot;}\nconsole.log(myArrayIterator.get(&#39;myMapKey&#39;));\n// Object {name: &quot;julien&quot;, aka: &quot;darul&quot;}\n</code></pre>\n<h4 id=\"example-with-native-javascript-array-\">Example with native javascript Array []</h4>\n<p>Purpose of this example is to get an Iterable obj from a native javascript array.</p>\n<p>Then play with all methods available on <a href=\"http://facebook.github.io/immutable-js/docs/#/IndexedIterable\">it</a></p>\n<pre><code class=\"lang-javascript\">// constructor from documentation\n// take an array\nIterable&lt;T&gt;(array: Array&lt;T&gt;): IndexedIterable&lt;T&gt;\n// return and IndexIterable obj\n</code></pre>\n<p>in practice</p>\n<pre><code class=\"lang-javascript\">var myArray = [1,2,3];\nconsole.log(Immutable.Iterable.isIterable(myArray)); // false\nvar myArrayIterator = Immutable.Iterable(myArray);\nconsole.log(Immutable.Iterable.isIterable(myArrayIterator)); // true\nconsole.log(myArrayIterator.first()); // 1\nconsole.log(myArrayIterator.get(2)); // 3\n</code></pre>\n<p>Behind it looks like <a href=\"http://facebook.github.io/immutable-js/docs/#/Seq\">Seq</a> is used.</p>\n<h3 id=\"keypath\">KeyPath</h3>\n<p>What is it ?</p>\n<p>A keypath seach for you data according to a path represented by a sum of keys.</p>\n<p>&quot;Returns the value found by following a path of keys or indices through nested Iterables.&quot;</p>\n<p>Signature</p>\n<pre><code class=\"lang-javascript\">getIn(searchKeyPath: Array&lt;any&gt;, notSetValue?: any): any\n</code></pre>\n<p>Example</p>\n<pre><code class=\"lang-javascript\">var value = {\n name: &#39;julien&#39;,\n aka: &#39;darul75&#39;,\n address: {\n  city: &#39;paris&#39;,\n  country: &#39;france&#39;\n }\n};\nvar myMap = Immutable.Map({});\nmyMap = myMap.set(&#39;myMapKey&#39;, Immutable.fromJS(value)); // convert plain object to an Immutable Map\nconsole.log(myMap.getIn([&#39;address&#39;, &#39;city&#39;]));\n// &#39;paris&#39;\n</code></pre>\n<p>Many functions can be used as setIn(), deleteIn(), updateIn(), mergeIn()....</p>\n<p>You can also edit this article by pressing edit button.</p>\n<p><img src=\"/images/posts/building-bricks-wall-gutter.jpg\" alt=\"Just for fun\"></p>\n<hr>\n<p>Tags: <em>ImmutableJS</em> <em>Javascript</em></p>\n";

