	module.exports = "<p>Before that we focus at webpack hot module replacement, let&#39;s see some reasons why I choosed React/Webpack couple to create my blog and some extra websites:</p>\n<ul>\n<li>build must be fast</li>\n<li>development must be fast</li>\n<li>learning stack must be fast</li>\n<li>rendering must be fast</li>\n<li>SEO has to be good :)\n..and :</li>\n</ul>\n<p>With AngularJS, I have to admit learning curve was not that easy and even Meteor solution is sticked to lot of things behind.</p>\n<p>I learn React step by step (sometimes 2 steps), component lyfecycle, virtual dom concepts and all that kind of stuff and it is just the beginning.</p>\n<p>React facilitates isomorphism which is mainly a good approach for SEO when coding essentially in Javascript.</p>\n<p>Then a very common task developer dislikes, as it is very time consuming, consist in handling deployment, build etc... Grunt, Gulp help us, Browserify is very nice but Webpack is a monster.</p>\n<p>I wrote this article after having played with webpack HMR module and its API.</p>\n<p>If you do not know webpack, do not worry, you still have time to play with it, and you should :)</p>\n<h2 id=\"live-coding-in-react\">Live coding in React</h2>\n<p>You may all know <a href=\"https://github.com/gaearon/\">@gaearon</a> who put a big stone with <a href=\"https://github.com/gaearon/react-hot-loader\">react-hot-loader</a></p>\n<p>Purpose of this webpack&#39;s loader ( we will see later what is a &#39;loader&#39;) is to reload (re inject) in live your react components with your live code updates. To resume, you code with your favorite editor and webpack rebundle everything for you in live and re render page with updates.</p>\n<p>Entry code is here, I will give my explanations about it then:</p>\n<p><a href=\"https://github.com/gaearon/react-hot-loader/blob/master/index.js\">react-hot-loader</a></p>\n<h2 id=\"what-is-a-webpack-loader\">What is a webpack loader</h2>\n<p>As described in <a href=\"http://webpack.github.io/docs/using-loaders.html\">documentation</a>, loader are transformations that can be applied on a resource file. A specific loader is executed during webpack compilation process if current compiled file extension (ex: .jpeg, .js, ...) matches loader&#39;s configuration.</p>\n<p>By instance, imagine an image file and a loader generating thumbnails from it in different sizes.</p>\n<p>A loader is mainly specified by :</p>\n<ul>\n<li>an extension(s) file to match: .png, .js, .whatever</li>\n<li>a name</li>\n</ul>\n<p>Availables <a href=\"http://webpack.github.io/docs/list-of-loaders.html\">loaders</a></p>\n<h2 id=\"write-a-loader\">Write a loader</h2>\n<p>Why ? because you may have specific needs, webpack is your swiss knife.</p>\n<p><a href=\"http://webpack.github.io/docs/how-to-write-a-loader.html\">documentation</a></p>\n<p>I give an example later, let&#39;s come back to React Hot loader first.</p>\n<h3 id=\"how-react-hot-loader-works\">How React Hot Loader works</h3>\n<p>To resume, react hot webpack loader <em>enhances</em> all of your js code files with some webpack HMR Hot Module Replacement javascript code stuffs.</p>\n<p>Before loader has passed:</p>\n<pre><code class=\"lang-javascript\">MyComponent code\n</code></pre>\n<p>After</p>\n<pre><code class=\"lang-javascript\">Some HMR code\nMyComponent code\nSome HMR code\n</code></pre>\n<p>But what happens in this &quot;Some HMR code&quot; ?</p>\n<ul>\n<li>it checks current resource (.js|jsx file) is a React component and if not do nothing when HMR triggers an update event.</li>\n<li>it watches some HMR update events and when necessary reloads your react component by doing tricky stuff with current react component to be updated.</li>\n</ul>\n<h3 id=\"how-hmr-api-works\">How HMR api works</h3>\n<p>Concepts are explained <a href=\"http://webpack.github.io/docs/hot-module-replacement-with-webpack.html\">here</a> and example and api <a href=\"http://webpack.github.io/docs/hot-module-replacement.html\">here</a></p>\n<p>Until now I have just played with the following methods:</p>\n<pre><code class=\"lang-javascript\">// Accept code updates for the specified dependencies.\n// The callback is called when dependencies were replaced.\naccept(dependencies: string[], callback: (updatedDependencies))\n\n// Accept code updates for this module without notification of parents.\n// This should only be used if the module doesnt export anything.\naccept([errHandler])\n\ndispose(callback: (data: object))\n// called when update is triggered, data object may contain your logic, cache...\n// see webpack website for explanations :)\n</code></pre>\n<p>To play with HMR you need to use webpack HotModuleReplacementPlugin plugin, example of use can be found <a href=\"https://github.com/darul75/personal-blog/blob/master/examples/2015/2015-07-15_webpack-custom-loader-by-example/webpack.js\">here</a></p>\n<p>We will take a small example.</p>\n<p>main.js</p>\n<pre><code class=\"lang-javascript\">var dep = require(&#39;./dep&#39;);\nvar dep2 = require(&#39;./dep2&#39;);\n\ndep.doSomething(&quot;darul&quot;); // &quot;do darul&quot;\ndep2.doSomething(&quot;darul&quot;); // &quot;do DARUL&quot;\n</code></pre>\n<p>dep.js</p>\n<pre><code class=\"lang-javascript\">module.exports = {\n    doSomething: function(name) {\n        console.log(&#39;do &#39; + name);\n    }\n}\n</code></pre>\n<p>dep2.js</p>\n<pre><code class=\"lang-javascript\">module.exports = {\n    doSomething: function(name) {\n        console.log(&#39;do &#39; + name.toUpperCase());\n    }\n}\n</code></pre>\n<p>If you want your code to be aware of some HMR events you need to add some custom webpack code into you own code.</p>\n<pre><code class=\"lang-javascript\">// check if HMR is enabled\nif(module.hot) {\n  // do your stuff\n}\n</code></pre>\n<p>Then we update code from dep.js</p>\n<p>dep.js</p>\n<pre><code class=\"lang-javascript\">module.exports = {\n    doSomething: function(name) {\n    // console.log(&#39;do &#39; + name);\n        console.log(&#39;do something &#39; + name);\n    }\n}\n</code></pre>\n<p>If you do nothing, it will still output &#39;do darul&#39; to console, OMG.</p>\n<p>What you need is to enhance your module to accept or decline changes:</p>\n<p>main.js</p>\n<pre><code class=\"lang-javascript\">var dep = require(&#39;./dep&#39;);\nvar dep2 = require(&#39;./dep2&#39;);\n\ndep.doSomething(&quot;darul&quot;); // fn call\ndep2.doSomething(&quot;darul&quot;); // fn call\n\n// check if HMR is enabled\nif(module.hot) {\n   // example for putting something from current component\n   // module.hot.data = {\n   //        key: value\n   // };\n\n   // accept update of dependency\n   module.hot.accept([&quot;./dep.js&quot;, &quot;./dep2.js&quot;], function() {\n       // most of the time just reaffect require instance\n       // with new fresh dependency module\n       dep = require(&#39;./dep&#39;);\n       dep2 = require(&#39;./dep2&#39;);\n       // and maybe recall fn call again\n       dep.doSomething();\n       dep2.doSomething();\n   }\n}\n</code></pre>\n<h2 id=\"my-idea\">My idea</h2>\n<p>My idea was to create a loader which will enhance all my js files with the following HMR code:</p>\n<pre><code class=\"lang-javascript\">// check if HMR is enabled\nif(module.hot) {\n   // accept update of dependency\n   //\n   module.hot.accept([ALL_DEPENDENCIES_CALLED_IN_THIS_MODULE], function() {\n       // most of the time just reaffect require instance\n       // with new fresh dependencies\n       // iterate over all dependencies and require it again.\n       dep = require(&#39;./dep&#39;);\n       dep2 = require(&#39;./dep2&#39;);\n       // and maybe recall fn call from these modules.\n       dep.doSomething(params);\n       dep.doSomethingAgain(params);\n       dep2.doSomething();\n   }\n}\n</code></pre>\n<p>My loader code is here:</p>\n<p><a href=\"https://github.com/darul75/personal-blog/blob/master/examples/2015/2015-07-15_webpack-custom-loader-by-example/test-loader.js\">here</a></p>\n<h3 id=\"how-it-works-\">How it works ?</h3>\n<p>1&gt; using regexp to match all require instructions like</p>\n<pre><code class=\"lang-javascript\">var dep = require(&#39;something&#39;);\n</code></pre>\n<p>will extract &#39;name&#39; of variable and &#39;path&#39; of dependency which gives 2 strings &quot;dep&quot;/&quot;something&quot;.</p>\n<p>2&gt; using regexp to match function call for this required module, example</p>\n<pre><code class=\"lang-javascript\">var dep = require(&#39;something&#39;);\n\ndep.doSomething(params);\ndep.doSomethingAgain(params);\n</code></pre>\n<p>will extract which gives 2 strings &quot;doSomething(params)&quot;/&quot;doSomethingAgain(params)&quot;.</p>\n<p>After loader has finished working, your webpack code looks something like</p>\n<pre><code class=\"lang-javascript\">if (true) {\n    module.hot.accept([3, 4], function() {\n        dep = __webpack_require__(3);\n        dep2 = __webpack_require__(4);\n        dep.doSomething(params);\n        dep.doSomethingAgain(params);\n        dep2.doSomething();\n    });\n}\n</code></pre>\n<p>It is not perfect and all common nodejs modules or external library should be escaped...but that was a try.</p>\n<p>My react swiss kit it here <a href=\"https://github.com/darul75\">web-react</a></p>\n<p><img src=\"/images/posts/startup-photos.jpg\" alt=\"Just for fun\"></p>\n<hr>\n<p>Tags: <em>Javascript</em> <em>NodeJS</em> <em>React</em> <em>Webpack</em></p>\n";

