	module.exports = "<p>Few months ago, I coded on <a href=\"https://www.hackerrank.com\">hackerrank</a> by learning Go language. Tests there can be very tricky but you should take a look at them and practice sometimes. Today, I will show your a more concrete example with a reverse proxy implementation.</p>\n<p>Main role of this pattern is to filter network request by inspecting (modifying...) and route it (or not) somewhere else.</p>\n<p>For that case, we will play with <em>http</em> protocol but Go packages provide everything you may need to play with network other layers, TCP, UDP, IP...</p>\n<h2 id=\"learn-go-lang\">Learn Go lang</h2>\n<p>Simply start with the tour of Go <a href=\"http://tour.golang.org\">here</a> and <a href=\"https://gobyexample.com/\">examples</a></p>\n<p>This language is very intuitive, not so far from C language with some object oriented pattern like interface.</p>\n<h2 id=\"packages\">Packages</h2>\n<p>Go provides all the necessary <a href=\"http://golang.org/pkg/\">packages</a> to build you own application.</p>\n<h2 id=\"http\">Http</h2>\n<p><a href=\"https://golang.org/pkg/net/http/\">net/http</a>&#39;s package exposes what we do in most part of our daily life on the web: play with client, server, request, response..</p>\n<p>If you deep look at Go documentation which is not really readable according to me, you should find this sub httputil package and NewSingleHostReverseProxy <a href=\"https://golang.org/pkg/net/http/httputil/#ReverseProxy\">function</a></p>\n<pre><code class=\"lang-go\">func NewSingleHostReverseProxy(target *url.URL) *ReverseProxy\n</code></pre>\n<p>You provide a target URL and it returns a ReverseProxy instance which will do the work for you, OMG it is great.</p>\n<p>Then a simple call to</p>\n<pre><code class=\"lang-go\">func (p *ReverseProxy) ServeHTTP(rw http.ResponseWriter, req *http.Request)\n</code></pre>\n<p>Will forward the request, it sounds very good, let&#39;s try it.</p>\n<h2 id=\"scenario\">Scenario</h2>\n<p>You have a backend service somewhere accessible with an http interface. And you do not want it to be exposed directly or you want to put some custom rules to access it, as authentication, or with some arbitrary logic. Thus why not place a reverse proxy in front of your backend services.</p>\n<p>In this example, we will demonstrate role of our reverse proxy by forwarding all web request from server one (running on arbitrary 80 port) to another server somewhere, let&#39;s say <a href=\"http://127.0.0.1:8080\">http://127.0.0.1:8080</a></p>\n<p>Resume</p>\n<ul>\n<li>our program will start a webserver running on 80</li>\n<li>all request made to this server will be transparently forward to targeted webserver and response sent to first server.</li>\n</ul>\n<h2 id=\"forward-trafic\">Forward trafic</h2>\n<p>When you start, do not worry about making things simple, with no struct, here I have just created a simple struct called Prox which is responsible to make business logic of reverse proxy.</p>\n<p>Here are some examples of <a href=\"https://tour.golang.org/moretypes/4\">struct</a> usage and pointers method receivers with Go <a href=\"https://tour.golang.org/methods/1\">receivers</a></p>\n<h3 id=\"simple-proxy\">Simple proxy</h3>\n<pre><code class=\"lang-go\">\n// our RerverseProxy object\ntype Prox struct {\n  // target url of reverse proxy\n    target *url.URL\n  // instance of Go ReverseProxy thatwill do the job for us\n    proxy  *httputil.ReverseProxy\n}\n\n// small factory\nfunc New(target string) *Prox {\n  url, _ := url.Parse(target)\n  // you should handle error on parsing\n  return &amp;Prox{target: url,proxy: httputil.NewSingleHostReverseProxy(url)}\n}\n\nfunc (p *Prox) handle(w http.ResponseWriter, r *http.Request) {\n    w.Header().Set(&quot;X-GoProxy&quot;, &quot;GoProxy&quot;)\n  // call to magic method from ReverseProxy object\n    p.proxy.ServeHTTP(w, r)\n}\n</code></pre>\n<h3 id=\"main-example\">Main example</h3>\n<p>Flag Go Flag package is very nice to put some command line options.</p>\n<pre><code class=\"lang-go\">func main() {\n  // come constants and usage helper\n  const (\n    defaultPort = &quot;:80&quot;\n    defaultPortUsage = &quot;default server port, &#39;:80&#39;, &#39;:8080&#39;...&quot;\n    defaultTarget = &quot;http://127.0.0.1:8080&quot;\n    defaultTargetUsage = &quot;default redirect url, &#39;http://127.0.0.1:8080&#39;&quot;\n  )\n\n  // flags\n  port := flag.String(&quot;port&quot;, defaultPort, defaultPortUsage)\n  url := flag.String(&quot;url&quot;, defaultTarget, defaultTargetUsage)\n\n  flag.Parse()\n\n  fmt.Println(&quot;server will run on : %s&quot;, *port)\n  fmt.Println(&quot;redirecting to :%s&quot;, *url)\n\n  // proxy\n  proxy := &amp;Prox{}\n  proxy.New(*url)\n\n  // server\n  http.HandleFunc(&quot;/&quot;, proxy.handle)\n  http.ListenAndServe(*port, nil)\n}\n</code></pre>\n<p>Go tools can compile your code to get a binary executable program.</p>\n<pre><code class=\"lang-go\">go run build yourfile.go\n</code></pre>\n<h2 id=\"forward-trafic-with-logic-inside\">Forward trafic with logic inside</h2>\n<p>Our first example had no logic but you can easily add you own.</p>\n<ul>\n<li>add security tests</li>\n<li>check number of requests done..</li>\n<li>filter query path, what we will do here.</li>\n<li>...</li>\n</ul>\n<p>Let&#39;s register one regular expression which applied to all requests path allows or disallows forwarding to our target url.</p>\n<h3 id=\"advanced-proxy\">Advanced proxy</h3>\n<pre><code class=\"lang-go\">type Prox struct {\n  target        *url.URL\n  proxy         *httputil.ReverseProxy\n  routePatterns []*regexp.Regexp // add some route patterns with regexp\n}\n\nfunc New(target string) *Prox {\n  url, _ := url.Parse(target)\n\n  return &amp;Prox{target: url,proxy: httputil.NewSingleHostReverseProxy(url)}\n}\n\nfunc (p *Prox) handle(w http.ResponseWriter, r *http.Request) {\n  w.Header().Set(&quot;X-GoProxy&quot;, &quot;GoProxy&quot;)\n\n  if p.routePatterns == nil || p.parseWhiteList(r) {\n    p.proxy.ServeHTTP(w, r)\n  }\n}\n\nfunc (p *Prox) parseWhiteList(r *http.Request) bool {\n  for _, regexp := range p.routePatterns {\n    fmt.Println(r.URL.Path)\n    if regexp.MatchString(r.URL.Path) {\n      // let&#39;s forward it\n      return true\n    }\n  }\n  fmt.Println(&quot;Not accepted routes %x&quot;, r.URL.Path)\n  return false\n}\n</code></pre>\n<h3 id=\"full-main\">Full main</h3>\n<pre><code class=\"lang-go\">func main() {\n  const (\n    defaultPort             = &quot;:80&quot;\n    defaultPortUsage        = &quot;default server port, &#39;:80&#39;, &#39;:8080&#39;...&quot;\n    defaultTarget           = &quot;http://127.0.0.1:8080&quot;\n    defaultTargetUsage      = &quot;default redirect url, &#39;http://127.0.0.1:8080&#39;&quot;\n    defaultWhiteRoutes      = `^\\/$|[\\w|/]*.js|/path|/path2`\n    defaultWhiteRoutesUsage = &quot;list of white route as regexp, &#39;/path1*,/path2*....&quot;\n  )\n\n  // flags\n  port := flag.String(&quot;port&quot;, defaultPort, defaultPortUsage)\n  url := flag.String(&quot;url&quot;, defaultTarget, defaultTargetUsage)\n  routesRegexp := flag.String(&quot;routes&quot;, defaultWhiteRoutes, defaultWhiteRoutesUsage)\n\n  flag.Parse()\n\n  fmt.Println(&quot;server will run on : %s&quot;, *port)\n  fmt.Println(&quot;redirecting to :%s&quot;, *url)\n  fmt.Println(&quot;accepted routes :%s&quot;, *routesRegexp)\n\n  //\n  reg, _ := regexp.Compile(*routesRegexp)\n  routes := []*regexp.Regexp{reg}\n\n  // proxy\n  proxy := New(*url)\n  proxy.routePatterns = routes\n\n  // server\n  http.HandleFunc(&quot;/&quot;, proxy.handle)\n  http.ListenAndServe(*port, nil)\n}\n</code></pre>\n<h2 id=\"note\">Note</h2>\n<p>By looking into <a href=\"http://golang.org/src/net/http/server.go\">go server</a> code, you can see that a go <a href=\"https://golang.org/doc/effective_go.html#goroutines\">routine</a> &quot;A goroutine is a lightweight thread of execution.&quot; is started on every request.</p>\n<pre><code class=\"lang-go\">func (h *timeoutHandler) ServeHTTP(w ResponseWriter, r *Request) {\n  done := make(chan bool, 1)\n  tw := &amp;timeoutWriter{w: w}\n  go func() {\n    h.handler.ServeHTTP(tw, r)\n    done &lt;- true\n  }()\n}\n</code></pre>\n<h2 id=\"conclusion\">Conclusion</h2>\n<p>It was just a POC but you can easily change it <a href=\"https://github.com/darul75/personal-blog/blob/master/examples/2015/2015-07-22_go-lang-simple-reverse-proxy/go-reverse.go\">here</a> to start.</p>\n<p><img src=\"/images/posts/stairs-man-person-walking.jpg\" alt=\"Just for fun\"></p>\n<hr>\n<p>Tags: <em>Go</em></p>\n";

