	module.exports = "<p>In an ideal world, to clone an object we should invoke a native method named clone() and go drink a coffee, but no, we can&#39;t. In order to understand common manners to clone() an object in javascript, we will need to review some basics, a recap is always welcome, isn&#39;t it ?</p>\n<p>I will explain you what is going on when we deal with primitives, objects, references...and all that in one article, OMG.</p>\n<h2 id=\"primitives-are-immutable\">Primitives are immutable</h2>\n<p>Javascript defines six types of primitives:</p>\n<ul>\n<li>Boolean</li>\n<li>Null</li>\n<li>Undefined</li>\n<li>Number</li>\n<li>String</li>\n<li>Symbol (new in ECMAScript 6)</li>\n</ul>\n<p>Which all are <em>Immutable</em> values, therefore most known side effect is when you pass it to some function, these are passed by value.</p>\n<pre><code class=\"lang-javascript\">var s1 = &quot;abc&quot;;\ns1[0] = &#39;z&#39;;\nconsole.log(s1); // still &#39;abc&#39;\n\nvar number = 42;\nvar clone = number;\n\nclone = 22;\nconsole.log(number); // still &#39;42&#39;\n\nfunction doInc(num) {\n    num += 1;\n    // num === 43 yes but &#39;num&#39; here is just a copy by value..\n}\n\ndoInc(number);\nconsole.log(number); // still &#39;42&#39;\n</code></pre>\n<p>Well, so if you want to clone a primitive does it work like a charm ?</p>\n<pre><code class=\"lang-javascript\">var original = &#39;base&#39;;\nvar clone = original;\n// keep it mind here you haven&#39;t made a copy but just\n// created a reference to the same data.\n\nconsole.log(clone === copy); // true\n\nclone = &#39;another&#39;;\n// here you change the reference but original still\n// reference same string immutable data &#39;base&#39;.\n\nconsole.log(original === clone); // false\n</code></pre>\n<p>Ok then you have already seen many examples like that.. let&#39;s see further.</p>\n<h2 id=\"objects\">Objects</h2>\n<p>&quot;In computer science, an object is a value in memory which is possibly referenced by an identifier.&quot; Mozilla.</p>\n<p>Take this example where we clone a simple object with some primitive properties.</p>\n<pre><code class=\"lang-javascript\">var original = {\n    prop: &#39;myProp&#39;\n};\n\n// let&#39;s clone it, sorry for this...\nvar clone = original; // :)\n\n// we have a very nice clone now, let&#39;s play\n// with it because we are confident.\nclone.prop = &#39;it is so simple to clone object&#39;;\n\nconsole.log(clone.prop); // ok fine\nconsole.log(original.prop); // oh no !\n</code></pre>\n<p>Ok that was simple and stupid but I am quite sure we all made it one time.</p>\n<p>You have just created a reference to original object, sorry I repeat myself.</p>\n<h2 id=\"how-to-clone-in-one-word\">How to clone in one word</h2>\n<p>Many libraries like UnderscoreJS, JQuery, and now <strong>Lodash</strong> do that very well therefore to <strong>avoid reinvent the wheel</strong> simply use it.</p>\n<h2 id=\"shallow-copy\">Shallow copy</h2>\n<p>What is it ?</p>\n<p>Look at this piece of code with a side effect that you should know when using a shallow copy.</p>\n<p><strong>Primitives only</strong></p>\n<pre><code class=\"lang-javascript\">var _ = require(&#39;lodash&#39;);\n\nvar obj = {\n    prop: 42\n};\n\nvar clone = _.clone(obj);\n// assign new property value\nclone.prop = 21;\n\n// some checks\nclone.prop === 21; // TRUE sure\n// and\nobj.prop === 42; // STILL true\n</code></pre>\n<p><strong>With object</strong></p>\n<pre><code class=\"lang-javascript\">var _ = require(&#39;lodash&#39;);\n\nvar obj = {\n    prop: {\n      number: 42\n  }\n};\n\nvar clone = _.clone(obj);\n// assign new value on &#39;number&#39; property\nclone.prop.number = 21;\n\n// check on original cloned object\nobj.prop.number !== 42; // yes indeed\nobj.prop.number === 21; // yes indeed\n\n// &#39;prop&#39; property in &#39;clone object&#39; is just a reference\n// to prop object from &#39;original object&#39;\n</code></pre>\n<p>The same is not true if you use lodash deep parameter, but we will see it later.</p>\n<h2 id=\"lodash-clone-function\">Lodash clone function</h2>\n<p>Here I propose we decorticate <strong>Lodash</strong> clone() method to see how it works.</p>\n<p>Signature may first look little bit complicated, many parameters... but that is fine ;)</p>\n<pre><code class=\"lang-javascript\">function cloneObject(value, deep, customizer, key, object, stackA, stackB)\n</code></pre>\n<p>Focus on 2 first params, value and deep.</p>\n<ul>\n<li>value is your value to be cloned first, but this method can/will be called recursively on each of your nested object/array attributes.</li>\n<li>deep option will invoke a more robust copy traversing all your attributes and so one for each nested object/array/function.</li>\n</ul>\n<p>By default, with no depth parameter (&#39;shallow&#39; copy), only your primitive values on first level will be well cloned, all other objects/array nested inside it will become references to original.</p>\n<h3 id=\"lodash-clone-with-no-deep\">Lodash clone with no deep</h3>\n<p>Symplified by me, I have escaped the case of arrays, here is an extract of lodash code.</p>\n<pre><code class=\"lang-javascript\">function cloneObject(value, deep, customizer, key, object, stackA, stackB) {\n    var result;\n  var isDeep = deep; // false in this case\n\n  // case value is just a primitive, return it\n  if (!isObject(value)) {\n    return value;\n  }\n\n  if (/* NOT A PRIMITIVE =&gt; OBJECT */) {\n      result = initCloneObject(value);\n    }\n\n  // here we are in case of a shallow copy, so\n  // we do not look for nested object, just first level.\n    if (!isDeep) {\n      return baseAssign(result, value);\n    }\n\n  return result;\n}\n</code></pre>\n<p>Let see both methods</p>\n<ul>\n<li>initCloneObject() creates new instances</li>\n<li>baseAssign() copy each object properties.</li>\n</ul>\n<pre><code class=\"lang-javascript\">function initCloneObject(object) {\n  var Ctor = object.constructor;\n  // look for your initial object constructor,\n  // or by default Object constructor\n  if (!(typeof Ctor == &#39;function&#39; &amp;&amp; Ctor instanceof Ctor)) {\n    Ctor = Object;\n  }\n  return new Ctor; // create instance\n}\n</code></pre>\n<p>It returns a new instance and to finish the job, we need to copy original object properties.</p>\n<pre><code class=\"lang-javascript\">function baseAssign(object, source) {\n  if (source == null) {\n    return object;\n  }\n  object || (object = {});\n  var props = Object.keys(source); // enumerable props\n\n  var index = -1,\n      length = props.length;\n\n  while (++index &lt; length) {\n    var key = props[index];\n    object[key] = source[key]; // assign it to new object\n  }\n  return object;\n}\n</code></pre>\n<h3 id=\"lodash-clone-with-deep\">Lodash clone with deep</h3>\n<p>Ok, now let&#39;s go deeper and see how lodash handles the case you do not want only a shadow copy but a deep one, by traversing all your nested object properties.</p>\n<pre><code class=\"lang-javascript\">function cloneObject(value, deep, customizer, key, object, stackA, stackB) {\n  var result;\n  var isDeep = deep; // true in this case\n\n  // case value is just a primitive, return it\n  if (!isObject(value)) {\n    return value;\n  }\n\n  if (/* NOT A PRIMITIVE =&gt; OBJECT */) {\n    result = initCloneObject(value);\n  }\n\n  // condition not verified\n  if (!isDeep) {\n    return baseAssign(result, value);\n  }\n\n  // GO ON IN DEPTH !!\n  // HERE WE ARE\n\n  // - 1&gt; this method iterate over current object properties\n  // - 2&gt; use a callback to apply current cloneObject method recursively\n  var fn = createBaseFor();\n\n  fn(value, function(subValue, key) {\n    // start recursion for each properties of current object\n    // and go on until no more in hierarchy\n    // - 3&gt; assign result to current object property\n    result[key] = cloneObject(subValue, isDeep, customizer, key, value, stackA, stackB);\n  });\n\n  return result;\n}\n</code></pre>\n<p>Here is the content of createBaseFor() method.</p>\n<p>Note the use of an anonymous function, just to cache fromRight optional param.</p>\n<p>&#39;iteratee&#39; param is the callback we have seen before:</p>\n<pre><code class=\"lang-javascript\">function(subValue, key) {\n  // we create a new property on result object named &#39;key&#39;\n  // we calculate his clone and assign it\n  result[key] = cloneObject(subValue, isDeep, customizer, key, value, stackA, stackB);\n}\n</code></pre>\n<p>Here this useful method:</p>\n<pre><code class=\"lang-javascript\">function createBaseFor(fromRight) {\n  return function(object, iteratee, keysFunc) {\n    var iterable = toObject(object),\n        props = Object.keys(object), // iterate over our object properties\n        length = props.length,\n        index = fromRight ? length : -1;\n\n    while ((fromRight ? index-- : ++index &lt; length)) {\n      var key = props[index];\n      if (iteratee(iterable[key], key, iterable) === false) {\n        break;\n      }\n    }\n    return object;\n  };\n}\n</code></pre>\n<h2 id=\"conclusion\">Conclusion</h2>\n<p>I hope it gives you idea at how clone() method has to work.</p>\n<p>Array, Function properties are not illustrated but process is similar.</p>\n<p>Note that Lodash handles circular dependency as well during clone process.</p>\n<p>Based on that, you can guess how equal() Lodash method works.</p>\n<p>You can also edit this article by pressing edit button.</p>\n<p><img src=\"/images/posts/man-person-people-emotions.jpg\" alt=\"Just for fun\"></p>\n<hr>\n<p>Tags: <em>Javascript</em></p>\n";

